import React from "react";
import Form from "react-bootstrap/Form";

function SearchForm(){
    return(
        <Form>
            <Form.Group controlId="exampleForm.ControlInput1">
                <Form.Label>Search by Name</Form.Label>
                <Form.Control as="input"/>
            </Form.Group>
        </Form>
    )
}

export default SearchForm;
